import "bootstrap/dist/css/bootstrap.min.css";
import { BrowserRouter as Router, Route} from "react-router-dom";

import EditItems from "./components/edit-items.component";
import EditHours from "./components/edit-hours.component";

function App() {
  return (
    <Router>
      <Route path='/' exact component={website} />
      <Route path='/edit/:id' component={EditItems} />
      <Route path='/menu-add' component={website} />
      <Route path='/edithours-add' component={website} />
    </Router>
  );
}

export default App;
